  false,\n\t\"url\": null,\n\t\"notes\": \"The survey in this report was conducted
  to determine if natural resources under the trusteeship of Interior have been affected
  by the release of hazardous substances at, or emanating from, the Superfund site.
  This report was prepared in support of the Environmental Protection Agency's Superfund
  program under the provisions of an Interagency Agreement between the Fish and Wildlife
  Service and the EPA.    Based on mercury concentrations measured in water and biota
  collected from the site, both direct and indirect adverse effects may be predicted
  in migratory birds, fish and the ecosystem as a whole in the Carson River Mercury
  Site. Public health advisory for mercury has been posted by the State of Nevada
  Division of Health against eating fish from the Lahontan Reservoir, Carson River
  below Lahontan Reservoir and all waters in Lahontan Valley, a similar advisory has
  been posted for eating shovelers collected from the Carson Lake.\",\n\t\"license_title\":
